import React from "react";
import {Grid, Image, Text} from "../elements";
// import TimeCounting from "time-counting";


const CommentList = () => {
  return (
    <React.Fragment>
      <Grid padding="16px">
      <CommentItem />
        <CommentItem />
        <CommentItem />
        <CommentItem />
        <CommentItem />
        <CommentItem />
      </Grid>
    </React.Fragment>
  );
};

const option = {
    lang: "ko",
    objectTime: "2021-10-02 18:00:00",
    calculate: {
      justNow: 60
    }
  };



export default CommentList;


const CommentItem = (props) => {
    // const option = {
    //     lang: "ko",
    //     objectTime: "2021-10-02 18:00:00",
    //     calculate: {
    //       justNow: 60
    //     }
    //   };

    const {user_profile, user_name, user_id, post_id, insert_dt} = props;
    return (
        <Grid is_flex>
            <Grid is_flex width="auto">
                <Image shape="circle"/>
                <Text bold>{user_name}</Text>
            </Grid>
            <Grid is_flex margin="0px 4px">
                <Text margin="0px">{contents}</Text>
                <Text margin="0px">{option}</Text>
            </Grid>
        </Grid>
    )
}

CommentItem.defaultProps = {
    user_profile: "",
    user_name: "sungmin",
    user_id: "",
    post_id: 1,
    contents: "귀여운 고양이네요!",
    insert_dt: '2021-01-01 19:00:00',
}
